@UkraineGang @IngSocIsHere @JustinTrudeau @g20org @ZelenskyyUa People are dying because NATO and Zelensky convinced you that war was better than peace.

Nobody is arguing FOR Russia here. If you cared about your people, you'd be calling for peace too.

If you called for peace from the beginning, Ukraine would have not lost land. Now what?

@InnaSovsun We love how they speak in Ukrainian. They say Thank You in Ukrainian, not Russian.

And here we were, shaking in our boots thinking that beautiful Ukrainian language had been replaced by Russian.

